import React from "react"

class App10 extends React.Component {
    render() {

        return (
            <div>
                <h2>class based components</h2>
                <p>name:{this.props.name}</p>
                <p>age:{this.props.age}</p>
            </div>
        )
    }
}
App10.propType = {
    name: PropTypes.string,
    age: PropType.number
}

App10.defaultProps = {
    name: "harikrishna",
    age: "22"


}
export default App10;
